import React, { useState } from "react";
import "../Components/Form.css";

function Form() {
    
  function submitHandler(e) {
    e.preventDefault();
  }

  return (
    <div>
      <form onSubmit={submitHandler}>
        <input className="task" type="text" placeholder="Enter task.." />
        <input className="date" type="date" placeholder="Enter Deadline.." />
        <div className="btn">
          <button className="submit-btn">Submit</button>
        </div>
      </form>
    </div>
  );
}

export default Form;
